    false,nt"url": null,nt"notes": "This narrative report for Wheeler National
    Wildlife Refuge outlines Refuge accomplishments from September to December 1947.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    furbearers, predators, rodents, mammals, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing, haying, and timber removal. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, and violations. N-R forms and photographs are attached",nt"owner_org":
